public class JobTemplateFactory(string resourceName = null, Action<Humidifier.IoT.JobTemplate> factoryAction = null) : ResourceFactory<Humidifier.IoT.JobTemplate>(resourceName)
{

    internal List<InnerJobTemplateMaintenanceWindowFactory> MaintenanceWindowsFactories { get; set; } = [];

    internal InnerJobTemplateTimeoutConfigFactory TimeoutConfigFactory { get; set; }

    internal InnerJobTemplateJobExecutionsRetryConfigFactory JobExecutionsRetryConfigFactory { get; set; }

    internal InnerJobTemplateAbortConfigFactory AbortConfigFactory { get; set; }

    internal InnerJobTemplateJobExecutionsRolloutConfigFactory JobExecutionsRolloutConfigFactory { get; set; }

    internal InnerJobTemplatePresignedUrlConfigFactory PresignedUrlConfigFactory { get; set; }

    protected override Humidifier.IoT.JobTemplate Create()
    {
        var jobTemplateResult = CreateJobTemplate();
        factoryAction?.Invoke(jobTemplateResult);

        return jobTemplateResult;
    }

    private Humidifier.IoT.JobTemplate CreateJobTemplate()
    {
        var jobTemplateResult = new Humidifier.IoT.JobTemplate
        {
            GivenName = InputResourceName,
        };

        return jobTemplateResult;
    }
    public override void CreateChildren(Humidifier.IoT.JobTemplate result)
    {
        base.CreateChildren(result);

        result.MaintenanceWindows = MaintenanceWindowsFactories.Any() ? MaintenanceWindowsFactories.Select(x => x.Build()).ToList() : null;
        result.TimeoutConfig ??= TimeoutConfigFactory?.Build();
        result.JobExecutionsRetryConfig ??= JobExecutionsRetryConfigFactory?.Build();
        result.AbortConfig ??= AbortConfigFactory?.Build();
        result.JobExecutionsRolloutConfig ??= JobExecutionsRolloutConfigFactory?.Build();
        result.PresignedUrlConfig ??= PresignedUrlConfigFactory?.Build();
    }

} // End Of Class

